<!DOCTYPE html>
<html>
<head>
<style>
	body {
		background-color: black;
		color: white;
	}
	table {
		font-family: 'Handel Gothic', 'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', 'Lucida Sans Unicode', Geneva, Verdana, sans-serif;
		padding: 0 1em;
	}
	.panel {
		background-image: linear-gradient(#050570 1px, transparent 1px);
		background-size: 100% 1em;
	}
	thead {
		font-weight: bold;
		font-size: larger;
	}
	h1 {
		background-color: black;
		font-family: 'Handel Gothic', 'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', 'Lucida Sans Unicode', Geneva, Verdana, sans-serif;
		padding-left: 20px;
	}
	h2 {
		background-color: black;
		font-family: 'Handel Gothic', 'Lucida Sans', 'Lucida Sans Regular', 'Lucida Grande', 'Lucida Sans Unicode', Geneva, Verdana, sans-serif;
		padding: 0.5em 20px;
		border: solid white 1px;
	}
	tr {
		vertical-align: top;
	}
	td {
		font-weight: light;
		text-align: center;
		padding: .5em .5em 0;
		width: 10em;
	}
	.label polyline {
		fill: none;
		stroke: white;
		stroke-width: 1
	}
	.page2label {
		color:#66aaff;
		font-weight:light;
		font-size: small;
	}
	.button rect {
		fill: black;
		stroke: #050570;
		stroke-width: 1
	}
	.knob circle {
		fill: black;
		stroke: #050570;
		stroke-width: 1
	}
	.knob polygon {
		fill: white;
	}
	.knob td {
		padding: 0
	}
	.button td {
		padding: 0
	}
</style>
</head>
<body>
<script>
	function makeTriangleSVG() {
		return '<svg class="label" height="1em" width="2em" viewBox="0 -1 20 12"><polyline <polyline points="0,10 10,0 20,10"/>/></svg>'
	}
	function makeSquareSVG() {
		return '<svg class="label" height="1em" width="2em" viewBox="0 -1 20 12"><polyline points="0,10 0,0 10,0 10,10 20,10"/></svg>'
	}
	function makeThreeWaveSVG() {
		return '<svg class="label" height="1em" width="8em" viewBox="10 -1 70 12">\n								<polyline points="0,20 20,0, 20,20"/>\n								<polyline points="30,10 40,0 50,10"/>\n								<polyline points="60,10 60,0 70,0 70,10 80,10"/>\n							</svg>'
	}
	function makeTableCell(cellText, cellClass, doubleWide = false) {
		var cell = document.createElement('td');
		cell.innerHTML = cellText;
		cell.className = cellClass;
		if (doubleWide) {
			cell.colSpan = 2;
		}
		return cell;
	}
	function makeLabelCell(label, doubleWide = false) {
		return makeTableCell(label, 'label', doubleWide);
	}
	function makeLabelRow(columnArray, doubleWide = false) {
		var row = document.createElement('tr');
		row.className = 'label';
		columnArray.forEach(label => {
			row.appendChild(makeLabelCell(label, doubleWide));
		});
		return row;
	}
	function makeLabelRow2(columnArray, doubleWide = false) {
		var row = document.createElement('tr');
		row.className = 'page2label';
		columnArray.forEach(label => {
			row.appendChild(makeLabelCell(label, doubleWide));
		});
		return row;
	}
	function makeKnobCell(value, doubleWide) {
		// rotation 0 points straight up, 180 points straight down
		// values from 0-63 should be -145 to +145
		rotationValue = value * 290 / 62 - 145;
		var cell = document.createElement('td');
		cell.innerHTML = '<svg class="knob" height="4em" width="4em" viewBox="-1 -1 32 32">\n			<circle r="15" cx="15" cy="15"/>\n			<circle r="7" cx="15" cy="15"/>\n			<circle r="5" cx="15" cy="15"/>\n			<polygon points="15,0 18,8 12,8" transform="rotate('
			+ rotationValue +
			', 15, 15)"/></svg>';
		if (doubleWide) {
			cell.colSpan = 2;
		}
		return cell;
	}
	function makeKnobRow(valueArray, doubleWide = false) {
		var row = document.createElement('tr');
		row.className = 'knob';
		valueArray.forEach(value => {
			if (value == null) {
				row.appendChild(makeLabelCell('', doubleWide));
			}
			else {
				row.appendChild(makeKnobCell(value, doubleWide));
			}
		});
		return row;
	}
	function makeButtonSVG(value) {
		led = '';
		if (value) {
			led = '<circle style="fill:red" r="4" cx="15" cy="8"/>';
		}
		return '<svg class="button" height="3em" width="3em" viewBox="-1 -1 32 32">\n			<rect width="30" height="30"/>\n			<rect x="2" y="14" width="26" height="14"/>'
			+ led + '</svg>';
	}
	function makeButtonCell(value) {
		var cell = document.createElement('td');
		cell.innerHTML = makeButtonSVG(value);
		return cell;
	}
	function makeButtonRow(columnArray) {
		var row = document.createElement('tr');
		row.className = 'button';
		columnArray.forEach(value => {
			if (value == null) {
				row.appendChild(makeLabelCell(''));
			}
			else if (value == 0 || value == 1) {
				row.appendChild(makeButtonCell(value));
			}
			else if (Array.isArray(value)) {
				var cell = document.createElement('td');
				if (value[0] == 'triangle') {
					cell.innerHTML = makeTriangleSVG() + makeButtonSVG(value[1]);
				}
				else if (value[0] == 'square') {
					cell.innerHTML = makeSquareSVG() + makeButtonSVG(value[1]);
				}
				else if (value[0] == 's/h') {
					cell.innerHTML = 'S/H' + makeButtonSVG(value[1]);
				}
				row.appendChild(cell);
			}
		});
		return row;
	}
	function makeParameterGroupTable() {
		return document.createElement('table');
	}
	function makeMasterTable(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeLabelRow(['MASTER<br/>VOLUME', '', 'PROGRAM<br/>VOL/BAL']));
		table.appendChild(makeKnobRow([0, null, program.volume]));
		table.appendChild(makeLabelRow(['AUTO<br/>TUNE', '<br/>HOLD', 'CHORD/<br/>PAGE&nbsp;2']));
		table.appendChild(makeButtonRow([0, 0, 0]));
		table.appendChild(makeLabelRow(['', 'MASTER<br/>TUNE', '']));
		table.appendChild(makeKnobRow([null, 31, null]));
		return table;
	}
	function makeControlTable(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeLabelRow(['<br/>PORTAMENTO']));
		table.appendChild(makeKnobRow([program.portAmt]));
		table.appendChild(makeLabelRow(['<br/>UNISON']));
		table.appendChild(makeButtonRow([program.unison]));
		table.appendChild(makeLabelRow(['<br/>OSC&nbsp;2&nbsp;DETUNE']));
		table.appendChild(makeKnobRow([program.osc2Detune]));
		return table;
	}
	function makeModulationTable(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeLabelRow(['LFO<br/>RATE', 'MODULATION<br/>DEPTH 1', 'MODULATION<br/>DEPTH&nbsp;2']));
		table.appendChild(makeKnobRow([program.lfoFreq, program.fmAmnt, program.pwmAmnt]));
		table.appendChild(makeLabelRow(['WAVEFORM', 'OSC&nbsp;1&nbsp;FRQ', 'OSC&nbsp;1&nbsp;PWM']));
		table.appendChild(makeButtonRow([['triangle', program.lfoWaveTri], program.osc1FM, program.osc1PWM]));
		table.appendChild(makeLabelRow(['', 'OSC&nbsp;2&nbsp;FRQ', 'OSC&nbsp;2&nbsp;PWM']));
		table.appendChild(makeButtonRow([['square', program.lfoWaveSqr], program.osc2FM, program.osc2PWM]));
		table.appendChild(makeLabelRow(['', 'FILTER&nbsp;FRQ', 'VOLUME&nbsp;MOD']));
		table.appendChild(makeButtonRow([['s/h', program.lfoWaveSnH], program.filterFM, program.vcaMod]));
		return table;
	}
	function makeOscillatorsTable(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeLabelRow(['OSC&nbsp;1<br/>FREQUENCY', '1&nbsp;AND&nbsp;2<br/>PULSE&nbsp;WIDTH', 'OSC&nbsp;2<br/>FREQUENCY'], true));
		table.appendChild(makeKnobRow([program.vco1Freq, program.oscPWM, program.vco2Freq], true));
		table.appendChild(makeLabelRow(['WAVEFORM<br/>' + makeThreeWaveSVG(), 'OSC&nbsp;2<br/>SYNC&nbsp;F-ENV', 'WAVEFORM<br/>' + makeThreeWaveSVG()], true));
		table.appendChild(makeButtonRow([program.osc1WaveTri, program.osc1WaveSqr, program.sync, program.fEnv, program.osc2WaveTri, program.osc2WaveSqr]));
		return table;
	}
	function makeFilterTable(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeLabelRow(['<br/>FREQUENCY', '<br/>RESONANCE', '<br/>MODULATION'], true));
		table.appendChild(makeKnobRow([program.vcfFreq, program.vcfRes, program.vcfMod], true));
		table.appendChild(makeLabelRow(['OSC&nbsp;1<br/>ON', 'OSC&nbsp;2<br/>HALF', '<br/>FULL', 'NOISE<br/>ON', '<br/>4&nbsp;POLE', 'KBD<br/>TRACK']));
		table.appendChild(makeButtonRow([program.osc2On, program.osc2Half, program.osc2On, program.noise, program.fourPole, program.kbdTrack]));
		return table;
	}
	function makeEnvelopesTable(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeLabelRow(['FILTER<br/>ATTACK', '<br/>DECAY', '<br/>SUSTAIN', '<br/>RELEASE']));
		table.appendChild(makeKnobRow([program.vcfAtk, program.vcfDcy, program.vcfSus, program.vcfRel]));
		table.appendChild(makeLabelRow(['VOLUME<br/>ATTACK', '<br/>DECAY', '<br/>SUSTAIN', '<br/>RELEASE']));
		table.appendChild(makeKnobRow([program.vcaAtk, program.vcaDcy, program.vcaSus, program.vcaRel]));
		return table;
	}
	
	function makeMasterTable2(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeLabelRow2(['', '', '']));
		return table;
	}
	function makeControlTable2(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeButtonRow([program.portBend]));
		table.appendChild(makeLabelRow2(['PORTAMENTO<br/>BEND']));
		table.appendChild(makeKnobRow([program.voiceDetune]));
		table.appendChild(makeLabelRow2(['VOICE&nbsp;DETUNE']));
		return table;
	}
	function makeModulationTable2(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeButtonRow([['triangle',  program.trigLfoWaveTri], program.fmQuant, program.pwmQuant]));
		table.appendChild(makeLabelRow2(['', 'QUANTIZE&nbsp;1<br/>&nbsp;', 'QUANTIZE&nbsp;2<br/>&nbsp;']));
		table.appendChild(makeButtonRow([['square', program.trigLfoWaveSqr], program.fmDlyInvert, program.pwmDlyInvert]));
		table.appendChild(makeLabelRow2(['', 'INVERT&nbsp;1<br/>&nbsp;', 'INVERT&nbsp;2<br/>&nbsp;']));
		table.appendChild(makeButtonRow([['s/h', program.trigLfoWaveSnH], program.lfoTrack, program.lfoRateDelay]));
		table.appendChild(makeLabelRow2(['TRIG<br/>WAVEVORM', 'LFO&nbsp;TRACK', 'LFO&nbsp;ENV&nbsp;MOD']));
		return table;
	}
	function makeOscillatorsTable2(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeButtonRow([program._90, program._180, program.vco1180, program.pw1180, program.portMatch, program.portQuant]));
		table.appendChild(makeLabelRow2(['90º', '180º','FREQUENCY','PULSE&nbsp;WIDTH', 'MATCH', 'QUANTIZE']));
		table.appendChild(makeLabelRow2(['LFO&nbsp;PHASE','OSC&nbsp;1&nbsp;LFO&nbsp;MOD&nbsp;INVERT', 'PORTAMENTO'],true));
		return table;
	}
	function makeFilterTable2(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeButtonRow([program.legato, program.constPort, program.expoPort]));
		table.appendChild(makeLabelRow2(['LEGATO', 'EQUAL&nbsp;TIME', 'EXPONENTIAL']));
		table.appendChild(makeLabelRow2(['-','PORTAMENTO','-']));
		return table;
	}
	function makeEnvelopesTable2(program) {
		var table = makeParameterGroupTable();
		table.appendChild(makeKnobRow([program.fmVibDelay, program.fmVibRaise, program.vcfSus, program.lfoTrigPoint]));
		table.appendChild(makeLabelRow2(['DELAY MOD 1', 'ATTACK MOD 1', '', 'LFO TRIG POINT']));
		table.appendChild(makeKnobRow([program.vcaAtk, program.pwmVibDelay, program.pwmVibRaise, program.pedalSustn]));
		table.appendChild(makeLabelRow2(['DELAY MOD 2', 'ATTACK MOD 2', '', 'PEDAL RELEASE']));
		return table;
	}
	function appendColumnWithTable(tableBodyRow, table) {
		var tableBodyColumn = document.createElement('td');
		tableBodyColumn.appendChild(table);
		tableBodyRow.appendChild(tableBodyColumn);
	}
	function appendProgramHeading(program) {
		var heading = document.createElement('h2');
		heading.innerHTML = 'Program ' + program.programGroup + '-' + program.programNumber + ' (' + program.programIndex + ')';
		document.body.appendChild(heading);
	}
	function appendProgramTable(program) {
		var programTable = document.createElement('table');
		programTable.className = 'panel';
		document.body.appendChild(programTable);
		var tableHead = document.createElement('thead');
		programTable.appendChild(tableHead);
		tableHead.appendChild(makeTableCell("MASTER", "category"));
		tableHead.appendChild(makeTableCell("CONTROL", "category"));
		tableHead.appendChild(makeTableCell("MODULATION", "category"));
		tableHead.appendChild(makeTableCell("OSCILLATORS", "category"));
		tableHead.appendChild(makeTableCell("FILTER", "category"));
		tableHead.appendChild(makeTableCell("ENVELOPES", "category"));
		var tableBody = document.createElement('tbody');
		programTable.appendChild(tableBody);
		var tableBodyRow = document.createElement('tr');
		tableBody.appendChild(tableBodyRow);
		appendColumnWithTable(tableBodyRow, makeMasterTable(program));
		appendColumnWithTable(tableBodyRow, makeControlTable(program));
		appendColumnWithTable(tableBodyRow, makeModulationTable(program));
		appendColumnWithTable(tableBodyRow, makeOscillatorsTable(program));
		appendColumnWithTable(tableBodyRow, makeFilterTable(program));
		appendColumnWithTable(tableBodyRow, makeEnvelopesTable(program));
		var tableBodyRow = document.createElement('tr');
		tableBody.appendChild(tableBodyRow);
		appendColumnWithTable(tableBodyRow, makeMasterTable2(program));
		appendColumnWithTable(tableBodyRow, makeControlTable2(program));
		appendColumnWithTable(tableBodyRow, makeModulationTable2(program));
		appendColumnWithTable(tableBodyRow, makeOscillatorsTable2(program));
		appendColumnWithTable(tableBodyRow, makeFilterTable2(program));
		appendColumnWithTable(tableBodyRow, makeEnvelopesTable2(program));
	}
